import React from 'react';
import './App.css';
import ListeGare from './ListeGare';
import firebase from 'firebase';

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      isLoggedIn: true,
    }
  }
  render() {
    if (firebase.auth().currentUser !== null) {
      return (
        <div className="App">
          <h1>Equipe de ligne</h1>
          <ListeGare />
        </div>
      );
    } else {
      return (
        <p>Connexion en cours</p>
      )
    }

  }
}

export default App;
